package com.fis.fw.core.entity;import javax.persistence.*;import java.util.Date;/** * com.fis.fw.core.entity.LogSend * TungHuynh * Created by sondt18@fpt.com.vn * Date 24/06/2019 9:47 AM */@Entity@Table(name="LOG_SEND", schema = "ADMIN_DTHGD")public class LogSend {    private static final long serialVersionUID = 1L;    @Id    @Column(name = "LOG_SEND_ID")    @GeneratedValue(strategy = GenerationType.SEQUENCE, generator = "LOG_SEND_SEQ")    @SequenceGenerator(schema = "ADMIN_DTHGD", sequenceName = "LOG_SEND_SEQ", name = "LOG_SEND_SEQ", allocationSize = 1)    private Integer logSendId;    @Column(name = "METHOD")    private String method;    @Column(name = "API_PARTNER_ID")    private Integer apiPartnerId;    @Column(name = "REQUEST_HEADER")    private String requestHeader;    @Column(name = "REQUEST_BODY")    private String requestBody;    @Column(name = "RESPONSE_STATUS")    private String responseStatus;    @Column(name = "RESPONSE_BODY")    private String responseBody;    @Column(name = "PROCESS_TIME")    private String processTime;    @Column(name = "CREATE_TIME")    @Temporal(TemporalType.TIMESTAMP)    private Date createTime;    @Column(name = "URL")    private String url;    @Column(name = "RETRY")    private Integer retry;    public Integer getLogSendId() {        return logSendId;    }    public void setLogSendId(Integer logSendId) {        this.logSendId = logSendId;    }    public String getMethod() {        return method;    }    public void setMethod(String method) {        this.method = method;    }    public Integer getApiPartnerId() {        return apiPartnerId;    }    public void setApiPartnerId(Integer apiPartnerId) {        this.apiPartnerId = apiPartnerId;    }    public String getRequestHeader() {        return requestHeader;    }    public void setRequestHeader(String requestHeader) {        this.requestHeader = requestHeader;    }    public String getRequestBody() {        return requestBody;    }    public void setRequestBody(String requestBody) {        this.requestBody = requestBody;    }    public String getResponseStatus() {        return responseStatus;    }    public void setResponseStatus(String responseStatus) {        this.responseStatus = responseStatus;    }    public String getResponseBody() {        return responseBody;    }    public void setResponseBody(String responseBody) {        this.responseBody = responseBody;    }    public String getProcessTime() {        return processTime;    }    public void setProcessTime(String processTime) {        this.processTime = processTime;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public String getUrl() {        return url;    }    public void setUrl(String url) {        this.url = url;    }    public Integer getRetry() {        return retry;    }    public void setRetry(Integer retry) {        this.retry = retry;    }}